import React, { useState, useEffect } from 'react';
import './App.css';
// Temporarily comment out these imports if the files don't exist:
// import { auth, provider, signInWithPopup, signOutUser } from './firebase'; 
// import PaymentPage from './PaymentPage';

function App() {
  // State variables
  const [users, setUsers] = useState([]);
  const [parkingSpaces, setParkingSpaces] = useState([]);
  const [bookings, setBookings] = useState([]);

  const [initialLoading, setInitialLoading] = useState(true); 
  const [error, setError] = useState(null);
  const [screen, setScreen] = useState('landing'); 

  const [user, setUser] = useState(null);
  const [isMenuOpen, setIsMenuOpen] = useState(false); 

  const [showPayment, setShowPayment] = useState(false);
  const [paymentAmount, setPaymentAmount] = useState(0);

  // Owner form states
  const [ownerForm, setOwnerForm] = useState({
    name: '', email: '', size: '', gate: false, evCharging: false,
    shed: false, cctv: false, location: '', price: '', image: null
  });

  // Renter form states
  const [renterForm, setRenterForm] = useState({
    name: '', email: '', phone: '', carType: '', date: '',
    startTime: '', endTime: '', price: 0, image: null
  });

  const API_URL = 'http://localhost:8081';

  // Form handlers
  const handleOwnerFormChange = (field, value) => {
    setOwnerForm(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const handleRenterFormChange = (field, value) => {
    setRenterForm(prev => ({
      ...prev,
      [field]: value
    }));
  };

  // Basic handlers
  const handleBack = () => {
    if (showPayment) {
      setShowPayment(false);
    } else if (screen === 'owner' || screen === 'renter') {
      setScreen('dashboard');
    } else {
      setScreen('landing');
    }
  };

  const calculatePrice = () => {
    if (!renterForm.startTime || !renterForm.endTime || !renterForm.date) return 0;
    const start = new Date(`${renterForm.date}T${renterForm.startTime}`);
    const end = new Date(`${renterForm.date}T${renterForm.endTime}`);
    const diffMs = end - start;
    const diffHours = diffMs > 0 ? diffMs / (1000 * 60 * 60) : 0;
    const pricePerHour = 50;
    return Math.round(diffHours * pricePerHour * 100) / 100;
  };

  const handleOwnerSubmit = async (e) => { 
    e.preventDefault(); 
    alert('Parking space registered successfully!'); 
    setScreen('dashboard');
  };

  const handleRenterSubmit = async (e) => { 
    e.preventDefault(); 
    const price = calculatePrice();
    if (price <= 0) { 
      alert('Please select valid start and end times for booking.'); 
      return; 
    }
    setPaymentAmount(price);
    setShowPayment(true);
  };

  // Simple screens for testing
  const LandingScreen = () => (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>HelloServe</h1>
      <p>Smart Parking Platform</p>
      <button onClick={() => setScreen('dashboard')} style={{ padding: '10px 20px', marginTop: '20px' }}>
        Continue to Dashboard
      </button>
    </div>
  );

  const DashboardScreen = () => (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h2>Welcome to Your Portal</h2>
      <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', marginTop: '20px' }}>
        <button 
          onClick={() => setScreen('owner')}
          style={{ padding: '20px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '5px' }}
        >
          Property Owner
        </button>
        <button 
          onClick={() => setScreen('renter')}
          style={{ padding: '20px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '5px' }}
        >
          Vehicle Renter
        </button>
      </div>
      <button onClick={handleBack} style={{ marginTop: '20px', padding: '10px 20px' }}>
        Back to Landing
      </button>
    </div>
  );

  const OwnerScreen = () => (
    <div style={{ padding: '20px' }}>
      <button onClick={handleBack}>← Back to Dashboard</button>
      <h2>Property Owner Form</h2>
      <form onSubmit={handleOwnerSubmit}>
        <div style={{ marginBottom: '10px' }}>
          <input 
            type="text" 
            value={ownerForm.name} 
            onChange={e => handleOwnerFormChange('name', e.target.value)} 
            placeholder="Full Name"
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
          <input 
            type="email" 
            value={ownerForm.email} 
            onChange={e => handleOwnerFormChange('email', e.target.value)} 
            placeholder="Email"
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
          <input 
            type="text" 
            value={ownerForm.location} 
            onChange={e => handleOwnerFormChange('location', e.target.value)} 
            placeholder="Location"
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
        </div>
        <button type="submit" style={{ padding: '10px 20px', backgroundColor: '#007bff', color: 'white', border: 'none' }}>
          Submit
        </button>
      </form>
    </div>
  );

  const RenterScreen = () => (
    <div style={{ padding: '20px' }}>
      <button onClick={handleBack}>← Back to Dashboard</button>
      <h2>Renter Form</h2>
      <form onSubmit={handleRenterSubmit}>
        <div style={{ marginBottom: '10px' }}>
          <input 
            type="text" 
            value={renterForm.name} 
            onChange={e => handleRenterFormChange('name', e.target.value)} 
            placeholder="Full Name"
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
          <input 
            type="date" 
            value={renterForm.date} 
            onChange={e => handleRenterFormChange('date', e.target.value)} 
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
          <input 
            type="time" 
            value={renterForm.startTime} 
            onChange={e => handleRenterFormChange('startTime', e.target.value)} 
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
          <input 
            type="time" 
            value={renterForm.endTime} 
            onChange={e => handleRenterFormChange('endTime', e.target.value)} 
            required
            style={{ width: '100%', padding: '10px', marginBottom: '10px' }}
          />
        </div>
        <p>Price: ₹{calculatePrice()}</p>
        <button type="submit" disabled={calculatePrice() <= 0} style={{ padding: '10px 20px', backgroundColor: '#28a745', color: 'white', border: 'none' }}>
          Proceed to Payment
        </button>
      </form>
    </div>
  );

  // Main render
  return (
    <div className="App">
      {screen === 'landing' && <LandingScreen />}
      {screen === 'dashboard' && <DashboardScreen />}
      {screen === 'owner' && <OwnerScreen />}
      {screen === 'renter' && !showPayment && <RenterScreen />}
      {showPayment && (
        <div style={{ padding: '20px', textAlign: 'center' }}>
          <button onClick={handleBack}>← Back</button>
          <h2>Payment Screen</h2>
          <p>Amount: ₹{paymentAmount}</p>
          <button onClick={() => { alert('Payment completed!'); setScreen('dashboard'); setShowPayment(false); }}>
            Complete Payment
          </button>
        </div>
      )}
    </div>
  );
}

export default App;
